import React from 'react';
import logo from './logo.svg';
import logo1 from './logo_oficial.png'; // relative path to image 
import './App.css';
import Navegation from './componentes/Navegation';
import Boton from './componentes/BtnLink';


function App() {
  return (
    <div className="App">
      <a href="#">
        <img src={logo1} className="logo" alt="logo" width="45px" height="45px" />
        lue Shopping
      </a>
      <div className="btns">
        <Boton name="Tienda" />
        <Boton name="Resgistrate" />
        <Boton name="Iniciar sesion" />
      </div>
    </div>
  );
}

export default App;
